import React from "react";
import { Box, Link, Typography } from "@mui/material";
import { Link as RouterLink } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom";

const HomePage = () => {
  const bgImage =
    "https://kartinkin.net/pics/uploads/posts/2022-08/1660339458_4-kartinkin-net-p-alma-ata-stolitsa-krasivo-foto-4.jpg";
  return (
    <Router>
<Box
  sx={{
    position: "fixed",
    top: 0,
    width: "100%",
    display: "flex",
    flexDirection: "row",
    justifyContent: "flex-start",
    alignItems: "center",
    backgroundColor: "rgba(0,0,0,0.5)",
    padding: "10px",
    zIndex: 1,
  }}
>
  <Link
    component={RouterLink}
    to="/"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    Главное
  </Link>
  <Link
    component={RouterLink}
    to="/top-places"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    Топ мест
  </Link>
  <Link
    component={RouterLink}
    to="/useful-info"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    Полезное
  </Link>
  <Link
    component={RouterLink}
    to="/about"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    О нас
  </Link>
</Box>
    </Router>
  );
};

export default HomePage;
